import React from 'react';
import './feature.css';

const Feature = ({title, text}) => {
	return (
		<div className='omntech__features-container_feature'>
			<div className="omntech__features-container__feature-title">
				<div/>
				<h1>{title}</h1>
			</div>
			<div className='omntech__features-container_feature-text'>{text}</div>
		</div>
	)
}

export default Feature
